    [Type.none, Type.none, Type.none],
    [Type.none, Type.none, Type.none],
    [Type.none, Type.none, Type.none]
]
const WinnerStatement: boolean[][] = [
    [false],[false],[false],
    [false],[false],[false],
    [false],[false],[false]
]

enum Turn {
    player1 = 'player1',
    player2 = 'player2'
}

const Game: FC<GameProps> = (
    {
        width = '400px',
        height = '400px'
    }) => {


    return (
        <div
            style={{
                width,
                height,
                display: 'flex',
                flexWrap: 'wrap',
                alignItems: 'center',
                justifyContent: 'space-around'

            }}
        >
            <IconButton color={'primary'}
            ><Toe onClick={console.log('clicked')}
                  type={Type.type_x}
                  win={false}/></IconButton>

            <WinnerAlert player={'me'}
            />


        </div>

    );

};


export default Game;
